    false,nt"url": null,nt"notes": "This annual narrative report for Muscatatuck
    NWR outlines Refuge accomplishments during the 1970 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, and
    reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, and Refuge participation. N-R forms, brochures, and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
